import React from 'react'
import UserListItem from '../component/UserListItem'
import { useQuery } from '@tanstack/react-query'
import USER_API from '../api/User'
import {useUserStore} from '../store/useUserStore'



const UserList = () => {

  const { selectedUserId, setSelectedUserId, setUserData } = useUserStore();

  const { isLoading,error, data} = useQuery({
    queryKey:['userList'],
    queryFn: () => USER_API.users,
    onSuccess: (data) => {
      setUserData(data)
    },
    onError: (error) => {
      console.error('Error fetching user list:', error);
    },
    //retry: 3, // 데이터를 가져오는 도중 실패했을 때 재시도할 횟수를 지정
    // staleTime: 1000 * 60 * 5, // 5 minutes, 데이터가 "stale" 상태로 간주되기까지의 시간입니다. 즉, 최신 데이터로 갱신하기 전에 이 기간 동안 캐시된 데이터를 사용
    // cacheTime: 1000 * 60 * 10, // 10 minutes, 캐시데이터 유효 시간
  })

  // console.log()

  return (
    <div>

      <UserListItem />
    </div>
  )
}

export default UserList
